class Solution:
    def minEatingSpeed(self, piles: list[int], h: int) -> int:

        start = 1
        end = max(piles)

        while start <= end:
            
            time = 0
            mid = (start + end) // 2

            for pile in piles:
                time += (pile + mid-1) // mid
            
            if time > h:
                start = mid + 1
            elif time <= h:
                result = mid
                end = mid - 1
        
        return result


